import { Container, Row, Col } from "react-bootstrap";
import Note from "./Note";

const FirstSection = () => {
  return (
    <Container className="businesses-index">
      <hr className="separator-sh"></hr>
      <h1>katalog spraw</h1>
      <Row>
        <Col>
          <h2>Wybierz swoją sprawę</h2>
          <Note name="note-left" />
        </Col>
        <Col></Col>
      </Row>
    </Container>
  );
};

export default FirstSection;
